"serviceWorker"in navigator&&window.addEventListener("load",()=>{navigator.serviceWorker.register("/sw.js").then(e=>e.update()).catch(e=>{console.log("Registration failed with "+e)})});let containers=document.querySelectorAll("#list a"),images=document.querySelectorAll("article"),links=document.querySelectorAll("ul li a");for(link of links)link.addEventListener("click",load);function load(){for(cont of containers){let e=document.createElement("div");cont.appendChild(e)}for(image of images)image.remove()}